import React from "react";
import axios from 'axios';
import {  Link,useNavigate } from 'react-router-dom'
import { useState, useEffect } from "react";
import Form from 'react-bootstrap/Form';
import './register.css'

export default function Register(props){

    const [isSignedUp, setIsSignedUp] = useState(false);

    const UserForm = () => {
    const [formData, setFormData] = useState({
        username: '',
        password: '',
        email: ''
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post('http://localhost:5000/users', formData)
        .then(response => {
            console.log(response.data);
            setFormData({
            username: '',
            password: '',
            email: ''
            });
        })
        .catch(error => {
            console.error(error);
        });
    };

    const [state, setState] = useState({
        name:"",
        username:"",
        email: "",
        password: "",
        confirm_password:"",
    });

    const navigate=useNavigate();
    const [type,setType]=useState("");


    };

    return(
        // <div>
        // {isSignedUp ? (
        //     <Product/>
        // ) : (
        <div className="register-body">
        <div class="wrapper">
         <div class="title-text">
            <div class="title signup">Signup</div>
         </div>
         <div class="form-container">
            <div class="form-inner">
               <form onSubmit={handleSubmit} class="signup">
                <div class="field">
                    <Form.Select aria-label="select user" value={type}  onChange={e => {
            console.log(e.target.value);
            setType(e.target.value);
          }} >
                    <option>User Type</option>
                    <option value="customer" >Customer</option>
                    <option value="seller" >Seller</option>
                    <option value="advertiser" >Advertiser</option>
                    </Form.Select>
                </div>
                  <div class="field">
                     <input type="text" placeholder="Name" name="name" value={state.name} 
              onChange={handleChange} required/>
                  </div>
                <div class="field">
                     <input type="text" placeholder="Username" name="username" value={state.username} 
              onChange={handleChange} required/>
                  </div>
                  <div class="field">
                     <input type="email" placeholder="Email Address" name="email" value={state.email} 
              onChange={handleChange} required/>
                  </div>
                  <div class="field">
                     <input type="password" placeholder="Password" name="password" value={state.password} 
              onChange={handleChange} required/>
                  </div>
                  <div class="field">
                     <input type="password" placeholder="Confirm password" name="confirm_password" value={state.confirm_password} 
              onChange={handleChange} required/>
                  </div>
                {/* <Link to={"/Product"}> */}
                  <div class="field btn-login">
                     <div class="btn-layer"></div>
                     <input type={"submit"} value="Signup"/>
                  </div>
                {/* </Link> */}
                <div class="signup-link">
                     Already have an account? <Link to={"/Login"}>Login</Link>
                  </div>
               </form>
            </div>
         </div>
      </div>
    </div>
        // )}
        // </div>
      
    );
}
